bool alive = true;

int reader_count = 0;

pthread_mutex_t reader_writer_ticket_mutex = PTHREAD_MUTEX_INITIALIZER;
pthread_mutex_t reader_ticket_mutex = PTHREAD_MUTEX_INITIALIZER;
pthread_mutex_t writer_ticket_mutex = PTHREAD_MUTEX_INITIALIZER;
pthread_mutex_t reader_mutex = PTHREAD_MUTEX_INITIALIZER;
pthread_mutex_t writer_mutex = PTHREAD_MUTEX_INITIALIZER;

/*
 * Reader    L0 .   <AAA...AA>  .
 *     0 A, 1 B, ...,  ,   <...> .
 *  reader <AAA...AA>   , critical section reader
 *    reader       .
 */
void *reader(void *arg)
{
    int id, i;
    id = *(int *)arg;

    while (alive)
    {
        pthread_mutex_lock(&reader_writer_ticket_mutex);
        pthread_mutex_lock(&reader_mutex);
        pthread_mutex_unlock(&reader_writer_ticket_mutex);
        reader_count++;
        if (reader_count == 1)
            pthread_mutex_lock(&writer_ticket_mutex);
        pthread_mutex_unlock(&reader_mutex);
        /*
         * Begin Critical Section
         */
        // 
        printf("<");
        for (i = 0; i < L0; ++i)
            printf("%c", 'A' + id);
        printf(">");
        /*
         * End Critical Section
         */
        pthread_mutex_lock(&reader_mutex);
        reader_count--;
        if (reader_count == 0)
            pthread_mutex_unlock(&writer_ticket_mutex);
        pthread_mutex_unlock(&reader_mutex);
    }

    pthread_exit(NULL);
}

void *writer(void *arg)
{
    int id, i;
    struct timespec req;
    id = *(int *)arg;
    srand(time(NULL));

    while (alive)
    {
        pthread_mutex_lock(&reader_writer_ticket_mutex);
        pthread_mutex_lock(&writer_ticket_mutex);
        pthread_mutex_unlock(&reader_writer_ticket_mutex);
        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id)
        {
        case 0:
            for (i = 0; i < L1; ++i)
                printf("%s\n", img1[i]);
            break;
        case 1:
            for (i = 0; i < L2; ++i)
                printf("%s\n", img2[i]);
            break;
        case 2:
            for (i = 0; i < L3; ++i)
                printf("%s\n", img3[i]);
            break;
        case 3:
            for (i = 0; i < L4; ++i)
                printf("%s\n", img4[i]);
            break;
        case 4:
            for (i = 0; i < L5; ++i)
                printf("%s\n", img5[i]);
            break;
        default:;
        }
        /*
         * End Critical Section
         */
        pthread_mutex_unlock(&writer_ticket_mutex);
        /*
         *    SLEEPTIME    .
         */
        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME;
        nanosleep(&req, NULL);
    }
    pthread_exit(NULL);
}

/*
 *   NREAD  reader  , NWRITE  writer  .
 *      0.2   alive  0   
 *       ,       .
 */
int main(void)
{
    int i;
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD];
    pthread_t wthid[NWRITE];
    struct timespec req;

    /*
     * Create NREAD reader threads
     */
    for (i = 0; i < NREAD; ++i)
    {
        rarg[i] = i;
        if (pthread_create(rthid + i, NULL, reader, rarg + i) != 0)
        {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /*
     * Create NWRITE writer threads
     */
    for (i = 0; i < NWRITE; ++i)
    {
        warg[i] = i;
        if (pthread_create(wthid + i, NULL, writer, warg + i) != 0)
        {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }
    /*
     * Wait for RUNTIME nanoseconds while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = RUNTIME;
    nanosleep(&req, NULL);
    /*
     * Now terminate all threads and leave
     */
    alive = false;
    for (i = 0; i < NREAD; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < NWRITE; ++i)
        pthread_join(wthid[i], NULL);
    /**
     *    
     */
    pthread_mutex_destroy(&reader_writer_ticket_mutex);
    pthread_mutex_destroy(&reader_ticket_mutex);
    pthread_mutex_destroy(&writer_ticket_mutex);
    pthread_mutex_destroy(&reader_mutex);
    pthread_mutex_destroy(&writer_mutex);

    return 0;
}
